webpackJsonp([0x804a83432fcb],{3877:function(a,t){a.exports={data:{markdownRemark:{html:'<p><a href="/!/thA/">東方時封城</a>製作終えてからなんか気力が出ない…やることはたくさんあるんだが。やはり人間修羅場を抜けたら相応の休息が必要なのかな。やっと1週間近くたってからなんか徐々にやる気が戻ってきた感じだし。 なんか現在使用している掲示板が来月一杯まででサービス終了とのことですので、<a href="https://twitter.com/danmaq">新掲示板</a>立ててみました。もし何かあれば利用していただければ幸いです。  それと休息がてら<a href="/tag/head">支配人紹介</a>ページを色々拡張してみました。今のところ今まで創作に携わってきたPCの紹介がメインですが、そのうち使ってきたDTM機材の紹介やらその他諸々やらしていきたい次第です。 でもそんな暇があるなら次s…ゲフンゲフン、え？何も言ってないですよ？</p>',frontmatter:{cover:null,date:"2005-07-20T00:00:00+09:00",strDate:"2005/7/19",title:"脱力"}}},pathContext:{path:"/ja/blog/2005/07/20-脱力/",langKey:"ja"}}}});
